import React, {useState, useEffect} from "react";
import Loader from "./Loader";

function Experience() {
  const experiences = [
    {
      title: "Software Engineer Intern",
      company: "Invitation Homes",
      duration: "Summer 2024",
      description: "Worked on building scalable web applications and improving system performance.",
    },
    {
      title: "Full-Stack Developer",
      company: "Personal Project",
      duration: "2023-2024",
      description: "Developed 'Fresh-Insights,' a full-stack app with Node.js, Express.js, React.js, and PostgreSQL.",
    },
  ];

  return (
    <div className="experience">
      <h1>Experience</h1>
      {experiences.map((exp, index) => (
        <div key={index} className="experience-item">
          <h2>{exp.title}</h2>
          <h3>{exp.company}</h3>
          <p>{exp.duration}</p>
          <p>{exp.description}</p>
        </div>
      ))}
    </div>
  );
}

export default Experience;
